        <MenuItem component={Link} to="/login">
          Login
        </MenuItem>
      </MenuList> */}

      <nav>
        <div>
          <div>
            <ul>
              <li>
                <Link to={"/home"} >Home</Link>
              </li>
              <li>
                <Link to={"/register"}>register</Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>

    </React.Fragment>
  );

}

export default router;
